On-going review- Link's Awakening remake
==================
Now to talk about the general gameplay, and how much it has improved!
If you don't know anything about this game, it's on a top-down view, keeping it old school. But that old school gameplay has been cleaned up and brought to the modern age.

Link's movements in the original were already smooth and not restricted to a grid. In the remake, Link continues to glide around the screen with all that expected Nintendo polish.

The controls are nice and responsive, and feels like a dream to play. This includes combat too. While it's not incredibly complicated, it's just been refined so well and remains fun throughout the entire game. There's good enemy variety that require different tactics in order to take them down.

There's just a perfect mix of combat, puzzle, and exploration (more on that in another post). Everything is designed so well and none of those components drag the others down. They compliment each other and gives what I believe is a perfectly balanced, and enjoyable, gameplay experience.
.
